import { Container } from "react-bootstrap";

import Header from "./components/header.js";
import Footer from "./components/footer";
import Home from "./screens/HomeScreen";

function App() {
  return (
    <div>
      <Header />

      <main className="py-3">
        <Container>
          <h1>Welcome</h1>
          <Home />
        </Container>

      </main>

      <Footer />
    </div>
  );
}

export default App;
